module.declare(["asteroids-at-home/main"], (require, exports, module) => {
          require.paths.push('asteroids-at-home')
          function progress(n) {
            if (typeof n === 'string') {
              n = parseFloat(n) / 100
            }
            postMessage({
              request: 'progress',
              value: n
            })
            return true
          }
          addEventListener("message", async (message) => {
            const data = Array.isArray(message.data.data) ? message.data.data : [message.data.data]
            const arguments = Array.isArray(message.data.arguments) ? message.data.arguments : [message.data.arguments]
            switch (message.data.request) {
              case 'main':
                const result = await (function worker (prd, mrqminParams, cgFirst, ndata, alpha, params, globals) {
      return require('main').asteroidsInnerLoop((1 / prd), mrqminParams, cgFirst, ndata, alpha, params, globals)
    })(...data, ...arguments)
                postMessage({
                  request: 'complete',
                  result:  result
                });
              break;
            }
          });
        });
